const HomePage = () => {
  return (
    <div className='homepage-container'>



        {/* <article>
          <h1>Official Melee Frame Data Quiz</h1>
          <p>What frame does this move come out on?</p>
        </article> */}

        <h1 className='homepage-title'>Official Melee Frame Data Quiz</h1>
        <h4 className='homepage-subtitle'>What frame does this move come out on?</h4>
        <button><a href='/quiz'>Click to Start</a></button>
    </div>
    
  )
}

export default HomePage
